import React, { useState, useEffect } from "react";
import PageTitle from "../components/Typography/PageTitle";
import { Input, Label, Select } from "@windmill/react-ui";
import { Button } from "@windmill/react-ui";

function HonoursMinors() {
  const [honoursMinors, setHonoursMinors] = useState(""); // New state for honours/minors registration

  const handleHonoursMinorsChange = (e) => {
    setHonoursMinors(e.target.value);
  };

  const handleSubmit = async () => {
    console.log("Form submitted successfully");

    try {
      const response = await fetch("http://localhost:5555/registerCourse", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(newRegistration),
      });

      if (response.ok) {
        setHonoursMinors("");
      } else {
        console.error("Failed to submit form");
        // Handle error
      }
    } catch (error) {
      console.error("Error submitting form:", error);
    }
  };

  return (
    <>
      <PageTitle>Honours/Minors Course Registration</PageTitle>
      <div className="px-4 py-3 mb-8 bg-white rounded-lg shadow-md dark:bg-gray-800">
        <div className="mt-4">
          <Label>Honour/Minors Registered</Label>
          <div className="mt-2">
            <Select
              className="mt-1"
              onChange={handleHonoursMinorsChange}
              value={honoursMinors}
            >
              <option value="">Select</option>
              <option value="YES">YES</option>
              <option value="NO">NO</option>
            </Select>
          </div>
        </div>
        <div className="mt-5">
          <Button onClick={handleSubmit}>Register</Button>
        </div>
      </div>
    </>
  );
}
    
export default HonoursMinors;
